import React from 'react';
import videoHorizontal from '../Assets/videos/horizontal'

function Video() {
  return (
    <div className="video-container">
      <video className="video" controls>
        <source src={videoHorizontal} type="video/mp4"/>
      </video>
    </div>
  );
}

export default Video;
